* {
  margin: 0;
  padding: 0;
  font: 12px/1.5 tahoma, arial, \5b8b\4f53;
}
#nav #disshow{
  display: none
}
#nav:hover #disshow{
    display: block;
}
a {
  text-decoration: none;
}
a:hover {
  text-decoration: underline;
}
ul {
  list-style: none;
}
.clearfix::after {
  content: "";
  display: block;
  clear: both;
}

.img_hover {
  transition: 0.2s linear;
}
.img_hover:hover {
  transform: translateX(-5px);
}

/* 顶部导航栏 */

.gn_head_nav {
  background-color: #f2f2f2;
  height: 29px;
  color: #999;
}
.w1190 {
  width: 1190px;
  margin: 0 auto;
}
.gn_head_nav .w1190 p {
  height: 29px;
  line-height: 29px;
  float: left;
}
.gn_head_nav .w1190 p a {
  color: #999;
}
.gn_head_nav .w1190 p .pl15 {
  padding-left: 15px;
}
.gn_head_nav .gn_fr {
  float: right;
}
.gn_head_nav .gn_fr ul li {
  float: left;
}
.gn_head_nav .gn_fr ul li:hover > a {
  color: #c40000;
}
.gn_head_nav .gn_fr ul li a {
  display: block;
  height: 29px;
  padding: 0 10px;
  line-height: 29px;
  color: #999;
}
.gn_head_nav .gn_fr ul li .down_drop {
  background: url(../img/images/drop_down_iconv.png) no-repeat right center;
  width: 60px;
}
.gn_head_nav .gn_fr ul li:hover ul {
  display: block;
}
.gn_head_nav .gn_fr ul li ul {
  display: none;
  position: absolute;
  z-index: 10;
  border-top: 1px solid #c40000;
}
.gn_head_nav .gn_fr ul li ul li {
  float: none;
}
.gn_head_nav .gn_fr .cart-pic {
  width: 17px;
  height: 17px;
  position: absolute;
  right: 10px;
  top: 6px;
  line-height: 17px;
  text-align: center;
  color: #fff;
  background: url(../img/images/icon_title_nav4.png) no-repeat 0 0;
}
.gn_head_nav .gn_fr .cart-pic_two {
  top: 36px;
}
.gn_head_nav .gn_fr .myfl {
  width: 80px;
}
.gn_head_nav .gn_fr ul li ul li a {
  background: #f5f5f5;
  color: #999;
}
.gn_head_nav .gn_fr ul li ul li a:hover {
  color: #c40000;
}

.gn_head_nav .gn_fr ul .cart span {
  float: left;
}
.gn_head_nav .gn_fr ul li .cart_pic1 {
  background: url(../img/images/icon_title1.png) no-repeat 0 0;
  display: block;
  width: 20px;
  height: 20px;
  margin-top: 5px;
}
.gn_head_nav .gn_fr ul .cart span a {
  color: #c40000;
  padding: 0;
}
.gn_head_nav .gn_fr ul li .cart_pic2 {
  background: url(../img/images/icon_title2.png) no-repeat 0 0;
  display: block;
  width: 17px;
  height: 17px;
  margin-top: 5px;
  color: #fff;
  text-align: center;
}

/* 商标部分 */

.logo-mid {
  padding: 15px 0;
}
.gn_wjlogo {
  width: 130px;
  margin-left: 10px;
  float: left;
}

.gn_wjSlogan {
  float: left;
  margin-left: 20px;
  height: 54px;
  width: 190px;
  line-height: 54px;
}
.gn_buycar {
  float: right;
  margin: 15px 0 0 125px;
  width: 150px;
}
.gn_buycar p {
  text-align: center;
  margin-left: -95px;
  margin-top: -10px;
}
.gn_search_qumall {
  float: right;
  position: relative;
  padding-left: 55px;
  top: 4px;
}
.gn_i-search {
  position: relative;
  width: 494px;
  height: 30px;
  border: 3px solid #c40000;
}
input#search_ipt {
  border: 0;
  margin: 0;
  width: 400px;
  background-color: transparent;
  padding: 2px 0 0 10px;
  position: absolute;
  color: #000;
  font-size: 100%;
  outline: none;
  line-height: 28px;
}
.gn_i-search button {
  background-color: #c40000;
  text-align: center;
  color: #fff;
  height: 30px;
  width: 78px;
  border: none;
  float: right;
  font: normal 16px/30px microsoft Yahei;
}
.gn_hotkeywords {
  padding-top: 8px;
  height: 20px;
  color: #999;
}
.gn_hotkeywords li {
  float: left;
  padding: 0 9px;
}
.gn_hotkeywords span {
  display: block;
  float: left;
}
.gn_hotkeywords li a {
  color: #999;
}
.gn_hotkeywords ul .hot-products a {
  color: #c40000;
}

/* 轮播图上方的导航 */

#gn_navbg {
  background-color: #c40000;
  width: 100%;
  min-width: 1190px;
  position: relative;
}
.all_products {
  height: 40px;
  line-height: 40px;
  position: relative;
  width: 1190px;
}
#gn_navbg .all_products {
  float: left;
  width: 180px;
  height: 40px;
  padding: 0 0 0 20px;
}
#gn_navbg .all_products a {
  color: #fff;
  font-size: 16px;
  font-family: "Microsoft Yahei";
}

.gn_nav li {
  float: left;
  padding-right: 15px;

  position: relative;
}
.gn_nav li a {
  font-size: 14px;
  color: #fff;
  text-align: center;
  padding: 0 25px;
  display: block;
  height: 40px;
  line-height: 40px;
  font-weight: bold;
}
.gn_nav li .nav_first {
  background-color: #db2020;
}
.gn_nav li a:hover {
  background-color: #db2020;
}
.head_icon {
  position: absolute;
  right: 20px;
  width: 20px;
  height: 20px;
}
#nav {
  width: 200px;
  position: absolute;
  background: #fff;
  opacity: 0.95;
  z-index: 10001;
}
#nav .mod_cate_hd {
  height: 40px;
  line-height: 40px;
  font-size: 16px;
  color: #fff;
  text-indent: 7px;
  background-color: #c40000;
}
#nav .mod_cate_hd h2 {
  line-height: 40px;
  padding-left: 15px;
  font-size: 16px;
  font-family: "Microsoft Yahei";
}

#nav > ul > li h2 a {
  color: #62615f;
  padding-right: 5px;
  font-size: 14px;
  font-family: "Microsoft Yahei";
}
#nav > ul > li {
  height: 25px;
  padding: 10px 10px 10px 35px;
}
#nav > ul > li span {
  float: left;
  background: url(../img/images/icon_totle.png);
  width: 17px;
  height: 17px;
  margin-top: 3px;
  padding-right: 10px;
}
#nav li .nav_icon1 {
  background-position: -23px -154px;
}
#nav li .nav_icon2 {
  background-position: -23px -180px;
}
#nav li .nav_icon3 {
  background-position: -23px -203px;
}
#nav li .nav_icon4 {
  background-position: -23px -232px;
}
#nav li .nav_icon5 {
  background-position: -23px -256px;
}
#nav li .nav_icon6 {
  background-position: -53px -23px;
}
#nav li .nav_icon7 {
  background-position: -170px -23px;
}
#nav li .nav_icon8 {
  background-position: -78px -23px;
}
#nav li .nav_icon9 {
  background-position: -107px -23px;
}

#nav li:hover .nav_icon1 {
  background-position: 3px -154px;
}
#nav li:hover .nav_icon2 {
  background-position: 3px -180px;
}
#nav li:hover .nav_icon3 {
  background-position: 3px -203px;
}
#nav li:hover .nav_icon4 {
  background-position: 3px -232px;
}
#nav li:hover .nav_icon5 {
  background-position: 3px -256px;
}
#nav li:hover .nav_icon6 {
  background-position: -53px 0px;
}
#nav li:hover .nav_icon7 {
  background-position: -170px 0px;
}
#nav li:hover .nav_icon8 {
  background-position: -78px 0px;
}
#nav li:hover .nav_icon9 {
  background-position: -107px 0px;
}

#nav li > div .gn-btlfin {
  padding: 0 15px;
  width: 770px;
}
#nav li > div .gn-btlfin .gn-btlfirst {
  width: 725px;
  height: 25px;
  border-bottom: 1px dashed #cbcbcb;
  overflow: hidden;
}
#nav li > div .gn-btlfin div h3 {
  color: #c40000;
  font-weight: 700;
  float: left;
  font-size: 12px;
  line-height: 25px;
}
#nav li > div .gn-btlfin div h4 {
  float: right;
  line-height: 25px;
}
#nav li > div .gn-btlfin div h4 a {
  color: #000;
}
#nav li > div .gn-btlfin div a {
  color: #888;
}
#nav li > div .gn-btlfin .gn-btlsecond ul {
  width: 725px;
}
#nav li div .gn-btlfin .gn-btlsecond li {
  background: none;
  float: left;
  padding: 0 8px;
  margin-left: 1px;
}
#nav li > div .gn-btlfin .gn-btlsecond li a:hover {
  color: #cc0000;
}

#nav li:hover {
  background: #db2020 url(../img/images/icon_right.png) no-repeat 160px 17px;
}
#nav li:hover a {
  color: #fff;
}
#nav li > div > div {
  display: none;
  width: 800px;
  height: 450px;
  position: absolute;
  background: #fff;
  left: 200px;
  top: 40px;
  padding: 0 15px;
  overflow-y: scroll;
  overflow-x: hidden;
}

#nav li:hover > div > div {
  display: block;
}
